import React, { useState, useEffect } from "react";
import {useHistory, useParams} from 'react-router-dom'
import Nav from "../nav/nav"
import '../../style.css';

import {Table} from 'reactstrap';


const ViewResume = () => {

    const [resumeData, setResumeData] = useState([]);

    // const history = useHistory();

    // const resumeInfo = {
    //     patientID:id, 
    //     careproviderID: careprovider
    // }

    // const resumeInfoEdit = {
    //     patientID:id, 
    //     patientEditID: patientEdit
    // }


  useEffect(() => {

    async function fetchData() {
      const res = await fetch(`http://localhost:4000/resume`);
      res.json().then((res) => setResumeData(res));

    }
    fetchData();
  });

//   // Go Back function
//   const goBack = () => {
//     history.goBack()
// }

  return (
    <div>
    <main>
        <Nav />
        <h3>Resume</h3>
          {resumeData.map((data) => 
        <Table striped>
            <thead>
                <tr>
                    <th>{data.job}HEAD</th>
                    <th>{data.jobTitle}</th>
                    <th>{data.date}DATE</th>
                </tr>
            </thead>

        </Table>
              )}
    </main>
    </div>
  );
};

export default ViewResume;
